svg.script:


  var xhttp = new XMLHttpRequest();
  xhttp.onreadystatechange = function() {
  if (this.readyState == 4 && this.status == 200) {
    var resp = JSON.parse(this.responseText);
    myFunction(resp.parts);
    }
  };
  xhttp.open("GET", "../../php/loader.php?params=main_parts", true);
  xhttp.send();

  function myFunction(arr) {
    var out = "";
    var i;
    for(i = 0; i < arr.length; i++) {
        out += "<path " + arr[i].image + " />";
    }
    document.getElementById("outer").innerHTML = out;
    console.log(out);
  }

  function init(evt){

    if ( window.svgDocument == null ){

      svgDocument = evt.target.ownerDocument;
    }
    tooltip = svgDocument.getElementById('tooltip');
  }

  function ShowTooltip(evt, mouseovertext){

  tooltip.setAttributeNS(null,"x",evt.clientX);
  tooltip.setAttributeNS(null,"y",evt.clientY);
  tooltip.firstChild.data = mouseovertext;
  tooltip.setAttributeNS(null,"visibility","visible");
}

function HideTooltip(){

  tooltip.setAttributeNS(null,"visibility","hidden");
}
